<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8">
    <title>Info-Vis-Personal-TP</title>
    <style>
      #timeChart > svg, #distanceChart > svg {
        display: block;
        margin-left: auto;
        margin-right: auto;
      }
      #timeChart, #distanceChart {
        width: 80%;
        display: block;
        margin-left: auto;
        margin-right: auto;
        border: solid 2px #607D8B;
      }
      body{
        font-family: Arial, Helvetica, sans-serif;
        margin: 0;
        background-color: #F5F5F5;
      }
      .navbar{
        background-color: #607D8B;
        padding: 10px 0;
        z-index: 9999;
        position: fixed;
        width: 100%;
        top: 0;
        -webkit-box-shadow: 0 8px 6px -6px #999;
        -moz-box-shadow: 0 8px 6px -6px #999;
        box-shadow: 0 8px 6px -6px #999;
      }
      .content{
        margin-top: 120px;
        margin-bottom: 20px;
      }
    </style>
  </head>
  <body>
    <div class="navbar">
      <div style="text-align: center;font-size: 24px;color:white">
        TIME AND DISTANCE ON FOOT OR IN VEHICLE
      </div>
      <div style="margin-top:10px;text-align: center;color:white">
        <span style="color:white;font-size:14px">You may use a custom google location .json file (a default one is already loaded)</span>
        <input type="file" id="fileInput" accept=".json"/>
      </div>
      <div style="text-align: center;margin-top:10px;">
        <input id="day" type="number" min="1" max="31" placeholder="Day" style="width:50px"/>
        <input id="month" type="number" min="1" max="12" placeholder="Month" style="width:50px"/>
        <input id="year" type="number" min="2000" max="2030" value="2018" placeholder="Year (2014-2019)" style="width:120px"/>
        <input id="aggregate" type="checkbox" checked/>
        <span style="color:white;font-size:14px">Aggregate</span>
        <button id="button" style="background-color:white;font-size:14px">Generate charts</button>
      </div>
    </div>
    <div class="content">
      <div id="locationsMap">
        <div style="text-align: center;font-size: 24px;color:#616161">PRE-LOADED LOCATIONS MAP</div>
        <img style="width: 800px;margin-left: auto;margin-right: auto;display: block;" src="https://lh3.googleusercontent.com/ODhWme1VXspFY3mrBA-PL3rXjYtUaaI1Fx9vDyamR9aIWrv_U6OfUyU2I9ZLLeoHYcWmLEA1rhdxG6u_BqDNjZqMPlnkINo85kLXbccRIcq_BgmaJ_cIuUkSAFoyrU_OVOI2LDaH1IrxamvKV7I-JsFv1nMtmOLv1wSsoe8seH7ldpxJvkR4JblitJas9PttjmB7uqDESjeQyiwQ4PvIAW383pn15fXGAKvoIyk53I7aSMH1G1ZuZrDyDsuLzYM_Ux4WLfA3ExFM6vKAmBczz9dVH4eHahd_BieqSxERHtayN0zsNjuW4BTSuJVszCARKECRsxgr3WzeK97TtpFsM8gHZkVC75NabrFNoyn2pe3m2_DbcXbTfGO16QYvN54RXwl6dfu5_rn4x7fYe5R2vA4vEuO1hwYHlIts3cYufCTdHt1VhZAj2XQu6QVZOGhzmxx7-q0OhH7LmTj3H1-Tehu1P6Y5dR3WHAzZv0wLzyUnXYqOtCEXTGUR12kLmxWIVIR3N4O8JuywxEuwPkYzRp9ki8RgFbnuWZ3P5IyESXeVO-MbgzFfkNc5C_P6p4PHsxN1EjyDARnMAZwS_3dwQrMhkrzWr1-M76aoz6kU680PPqH8mloaqTZFAyRCWOt_YiiZA52zG4AhMwp_GThkEjKV5yctsA=w2234-h1396-no"/>
      </div>
      <div style="margin-top: 10px">
        <div style="text-align: center;font-size: 24px;color:#616161">TIME CHART</div>

  <script type="text/javascript" src="https://ajax.googleapis.com/ajax/libs/jquery/3.4.0/jquery.min.js"></script>
  <script type="text/javascript" src="https://d3js.org/d3.v5.min.js" defer></script>
  <script type="text/javascript" src="https://cdnjs.cloudflare.com/ajax/libs/underscore.js/1.8.3/underscore.js" defer></script>
  <script type="text/javascript">
    $(document).ready(() => {
      generateCharts();
    });
    var readLocalFile = function(e) {
      let file = e.target.files[0];
      if (!file) {
        return;
      }
      let reader = new FileReader();
      reader.onload = function(e) {
        let result;
        result = processRawLocationHistory(JSON.parse(e.target.result));
        statistics = result[0];
        $("#locationsMap").css("display", "none");
        $("#year").attr("placeholder", `Year (${result[1]}-${result[2]})`);
      };
      reader.onloadstart = function(e) {
        $("#button").attr("disabled", true)
      };
      reader.onloadend = function(e) {
        $("#button").attr("disabled", false)
      };
      reader.readAsText(file);
    };
    var shortMonthName = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sept", "Oct", "Nov", "Dec"];
    var addBubblesToChildren = function(children, day, month, year, parentStatistic, aggregate, divideBy, type, color){
      if(_.isUndefined(day)){
        if(_.isUndefined(month)){
          if(aggregate){
            let byYearAggregated = _.reduce(Object.values(parentStatistic[year]), (memo, curr) => {
              return memo + _.reduce(Object.values(curr), (memo2, curr2) => {
                return memo2 + curr2;
              }, 0);
            }, 0);
            children.push({"Date": year, "Type": type, "Count": byYearAggregated/divideBy, "Color": color});
          }else{
            for(let monthProp in parentStatistic[year]){
              let byMonth = _.reduce(Object.values(parentStatistic[year][monthProp]), (memo, curr) => {
                return memo + curr;
              }, 0);
              children.push({"Date": shortMonthName[+monthProp - 1], "Type": type, "Count": byMonth/divideBy, "Color": color});
            }
          }
        } else if(aggregate){
          let byMonthAggregated = _.reduce(Object.values(parentStatistic[year][month]), (memo, curr) => {
            return memo + curr;
          }, 0);
          children.push({"Date": shortMonthName[+month - 1], "Type": type, "Count": byMonthAggregated/divideBy, "Color": color});
        } else {
          for(let day in parentStatistic[year][month]){
            if(parentStatistic[year][month][day]/divideBy){
              children.push({"Date": day, "Type": type, "Count": parentStatistic[year][month][day]/divideBy, "Color": color});
            }
          }
        }
      }else{
        if(parentStatistic[year][month][day]/divideBy){
          children.push({"Date": day, "Type": type, "Count": parentStatistic[year][month][day]/divideBy, "Color": color});
        }
      }
    };
    var drawBubbleChart = function(dataset, containerSelector, units){
      let diameter = 800;
      let bubble = d3.pack(dataset)
        .size([diameter, diameter])
        .padding(1.5);
      let svg = d3.select(containerSelector)
        .append("svg")
        .attr("width", diameter)
        .attr("height", diameter)
        .attr("class", "bubble")
        .call(d3.zoom().on("zoom", () => {
          svg.attr("transform", d3.event.transform);
          svg.attr("scale", d3.event.transform);
        }));
      let nodes = d3.hierarchy(dataset)
        .sum(function(d) { return d["Count"]; });
      let node = svg.selectAll(".node")
        .data(bubble(nodes).descendants())
        .enter()
        .filter(function(d){
          return !d.children
        })
        .append("g")
        .attr("class", "node")
        .attr("transform", function(d) {
          return "translate(" + d.x + "," + d.y + ")";
        });
      node.append("title")
        .text(function(d) {
            return d.data["Type"] + ": " + d.data["Count"].toFixed(2) + units;
        });
      node.append("circle")
        .attr("r", function(d) {
            return d.r;
        }).style("fill", function(d,i) {
            return d.data["Color"];
        });
      node.append("text")
        .attr("dy", "-1em")
        .style("text-anchor", "middle")
        .text(function(d) {
            return d.data["Date"];
        })
        .attr("font-size", function(d){
            return d.r/6;
        })
        .attr("fill", "white");
      node.append("text")
        .attr("dy", "0.4em")
        .style("text-anchor", "middle")
        .text(function(d) {
            return d.data["Type"].substring(0, d.r / 3);
        })
        .attr("font-size", function(d){
            return d.r/4;
        })
        .attr("fill", "white");
      node.append("text")
        .attr("dy", "1.4em")
        .style("text-anchor", "middle")
        .text(function(d) {
            return d.data["Count"].toFixed(2) + units;
        })
        .attr("font-size", function(d){
            return d.r/4;
        })
        .attr("fill", "white");
      d3.select(self.frameElement)
        .style("height", diameter + "px");
    };
    var drawTimeChart = function(drawOnFoot, drawOnVehicle, day, month, year, aggregate) {
      $("#timeChart").empty();
      let dataset = {
        children: []
      };
      if(drawOnFoot){
        addBubblesToChildren(dataset.children, day, month, year, statistics.onFootTimeSec, aggregate, 3600, "ON FOOT", "#1976D2");
      }
      if(drawOnVehicle){
        addBubblesToChildren(dataset.children, day, month, year, statistics.onVehicleTimeSec, aggregate, 3600, "VEHICLE", "#388E3C");
      }
      if(dataset.children.length > 0){
        drawBubbleChart(dataset, "#timeChart", "h");
      }
    };
    var drawDistanceChart = function(drawOnFoot, drawOnVehicle, day, month, year, aggregate) {
      $("#distanceChart").empty();
      let dataset = {
        children: []
      };
      if(drawOnFoot){
        addBubblesToChildren(dataset.children, day, month, year, statistics.onFootDistance, aggregate, 1000, "ON FOOT", "#1976D2");
      }
      if(drawOnVehicle){
        addBubblesToChildren(dataset.children, day, month, year, statistics.onVehicleDistance, aggregate, 1000, "VEHICLE", "#388E3C");
      }
      if(dataset.children.length > 0){
        drawBubbleChart(dataset, "#distanceChart", "km");
      }
    };
    var generateCharts = function(){
      let day = $("#day").val();
      let month = $("#month").val();
      let year = $("#year").val();
      let aggregate = $("#aggregate").prop("checked");
      drawTimeChart(true, true, day?day:undefined, month?month:undefined, year?year:undefined, !_.isUndefined(aggregate)?aggregate:undefined);
      drawDistanceChart(true, true, day?day:undefined, month?month:undefined, year?year:undefined, !_.isUndefined(aggregate)?aggregate:undefined);
    };
    $("#button").click(() => generateCharts());
    $("#fileInput").on('change', undefined, readLocalFile);
    var isSameTrackDate = function(lastLocationDate, currentLocationDate) {
      return lastLocationDate.getFullYear() == currentLocationDate.getFullYear() && lastLocationDate.getMonth()+1 == currentLocationDate.getMonth()+1 && lastLocationDate.getDate() == currentLocationDate.getDate() && ((currentLocationDate.getHours()*60+currentLocationDate.getMinutes())-(lastLocationDate.getHours()*60 + lastLocationDate.getMinutes())) <= 10;
    };
    var convertToGPSFormat = function(axis) {
      axis /= Math.pow(10, 7);
      if(axis > 180){
        axis -= (4294967295 / Math.pow(10, 7));
      }
      return axis;
    };
    var getDistanceBetween = function(location, other){
      let lon1 = convertToGPSFormat(location.longitudeE7) * Math.PI / 180;
      let lat1 = convertToGPSFormat(location.latitudeE7) * Math.PI / 180;
      let lon2 = convertToGPSFormat(other.longitudeE7) * Math.PI / 180;
      let lat2 = convertToGPSFormat(other.latitudeE7) * Math.PI / 180;
      let a = Math.pow(Math.sin((lat2-lat1)/2), 2) + Math.cos(lat1)*Math.cos(lat2)*Math.pow(Math.sin((lon2-lon1)/2), 2);
      let c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
      return 6371*Math.pow(10, 3) * c;
    };
    var isValidLocation = function(location) {
      return location.accuracy < 1000;
    };
    var isOnFoot = function(lastLocation, currentLocation) {
      let dist = getDistanceBetween(lastLocation, currentLocation);
      let distTime = (+currentLocation.timestampMs - +lastLocation.timestampMs);
      return dist/(distTime/1000) <= 3;
    }
    var isOnVehicle = function(lastLocation, currentLocation) {
      let dist = getDistanceBetween(lastLocation, currentLocation);
      let distTime = (+currentLocation.timestampMs - +lastLocation.timestampMs);
      return dist/(distTime/1000) > 3 && dist/(distTime/1000) < 45;
    }
    var processRawLocationHistory = function(rawLocationHistory){
      let locations = rawLocationHistory.locations;
      let auxStatistics = {
        onFootTimeSec: {},
        onVehicleTimeSec: {},
        onFootDistance: {},
        onVehicleDistance: {}
      };
      if(!locations || locations.length == 0){
        return [auxStatistics, "", ""];
      }
      let startIndex = 0;
      while(!isValidLocation(locations[startIndex])){
        startIndex++;
      }
      let lastLocation = locations[startIndex];
      let lastLocationDate = new Date(+lastLocation.timestampMs);
      let auxOnFootDistance = 0;
      let auxOnVehicleDistance = 0;
      let auxOnFootTime = 0;
      let auxOnVehicleTime = 0;
      let currentLocationDate;
      let auxYear = 0;
      let auxMonth = 0;
      let auxDay = 0;
      let minYear = 9999;
      let maxYear = 0;
      for(let i = startIndex + 1; i < locations.length; i++){
        currentLocation = locations[i];
        if(!isValidLocation(currentLocation)){
          continue;
        }
        currentLocationDate = new Date(+currentLocation.timestampMs);
        if(isSameTrackDate(lastLocationDate, currentLocationDate)){
          if(isOnVehicle(lastLocation, currentLocation)){
            auxOnVehicleDistance += getDistanceBetween(lastLocation, currentLocation);
            auxOnVehicleTime += (+currentLocation.timestampMs - +lastLocation.timestampMs);
          } else if(isOnFoot(lastLocation, currentLocation)){
            auxOnFootDistance += getDistanceBetween(lastLocation, currentLocation);
            auxOnFootTime += (+currentLocation.timestampMs - +lastLocation.timestampMs);
          }
        } else {
          auxYear = lastLocationDate.getFullYear();
          auxMonth = lastLocationDate.getMonth() + 1;
          auxDay = lastLocationDate.getDate();
          if(auxYear < minYear){
            minYear = auxYear;
          }
          if(auxYear > maxYear){
            maxYear = auxYear;
          }
          if(auxOnVehicleTime > 0){
            if(!auxStatistics.onVehicleDistance[auxYear]){
              auxStatistics.onVehicleDistance[auxYear] = {};
            }
            if(!auxStatistics.onVehicleDistance[auxYear][auxMonth]){
              auxStatistics.onVehicleDistance[auxYear][auxMonth] = {};
            }
            if(!auxStatistics.onVehicleTimeSec[auxYear]){
              auxStatistics.onVehicleTimeSec[auxYear] = {};
            }
            if(!auxStatistics.onVehicleTimeSec[auxYear][auxMonth]){
              auxStatistics.onVehicleTimeSec[auxYear][auxMonth] = {};
            }
            if(!auxStatistics.onVehicleTimeSec[auxYear][auxMonth][auxDay]){
              auxStatistics.onVehicleTimeSec[auxYear][auxMonth][auxDay] = 0;
            }
            if(!auxStatistics.onVehicleDistance[auxYear][auxMonth][auxDay]){
              auxStatistics.onVehicleDistance[auxYear][auxMonth][auxDay] = 0
            }
            auxStatistics.onVehicleDistance[auxYear][auxMonth][auxDay] += auxOnVehicleDistance;
            auxStatistics.onVehicleTimeSec[auxYear][auxMonth][auxDay] += (auxOnVehicleTime / 1000);
          }
          if(auxOnFootTime > 0){
            if(!auxStatistics.onFootDistance[auxYear]){
              auxStatistics.onFootDistance[auxYear] = {};
            }
            if(!auxStatistics.onFootDistance[auxYear][auxMonth]){
              auxStatistics.onFootDistance[auxYear][auxMonth] = {};
            }
            if(!auxStatistics.onFootTimeSec[auxYear]){
              auxStatistics.onFootTimeSec[auxYear] = {};
            }
            if(!auxStatistics.onFootTimeSec[auxYear][auxMonth]){
              auxStatistics.onFootTimeSec[auxYear][auxMonth] = {};
            }
            if(!auxStatistics.onFootTimeSec[auxYear][auxMonth][auxDay]){
              auxStatistics.onFootTimeSec[auxYear][auxMonth][auxDay] = 0;
            }
            if(!auxStatistics.onFootDistance[auxYear][auxMonth][auxDay]){
              auxStatistics.onFootDistance[auxYear][auxMonth][auxDay] = 0;
            }
            auxStatistics.onFootDistance[auxYear][auxMonth][auxDay] += auxOnFootDistance;
            auxStatistics.onFootTimeSec[auxYear][auxMonth][auxDay] += (auxOnFootTime / 1000);
          }
          auxOnVehicleDistance = 0;
          auxOnVehicleTime = 0;
          auxOnFootDistance = 0;
          auxOnFootTime = 0;
        }
        lastLocationDate = currentLocationDate;
        lastLocation = currentLocation;
	    }
	    return [auxStatistics, minYear, maxYear];
    };
  </script>
